import React from 'react';

function About() {
  return (
    <div className="about">
      <h1>About Us</h1>
      <p>Book_A_Taxi is a simple and user-friendly platform designed to help you book a taxi quickly and effortlessly. Whether you're heading to work, the airport, or just across town, our goal is to make your ride smooth and stress-free.</p>
      <p>We focus on what matters most: convenience, safety, and reliability. With trusted drivers and 24/7 availability, we’re here to get you where you need to go, when you need to be there — no guesswork, no hassle.</p>
      <p>At Book_A_Taxi, we’re committed to providing excellent customer service and making every ride a great experience.</p>
    </div>
  );
}

export default About;
